    const url = props.url;
    console.log(url);
    return (
        <div style={{ backgroundImage: 'url("https://images.pexels.com/photos/1718181/pexels-photo-1718181.jpeg?auto=compress&cs=tinysrgb&dpr=1&fit=crop&h=200&w=280")' }}> 
            
